import React, { useState, useEffect } from 'react';

const Userdata = () => {
  const x = 'https://jsonplaceholder.typicode.com/users';
  const [user, setUser] = useState([]);
  const User = async (x) => {
    try {
      const fetchData = await fetch(x);
      const res = await fetchData.json();
      if (res.length > 0) {
        setUser(res);
      }
    } catch (e) {
      console.error(e);
    }
  };

  useEffect(() => {
    User(x);
  });

  const handleKey = () => {
    const search = document.getElementById('email').value.toLowerCase();

    user.forEach((x) => {
      if (x.name == search) {
        console.log(x);
      }
    });
  };
  return (
    <div>
      <form>
        <input
          type="text"
          id="email"
          placeholder="Enter email address ..."
          onKeyUp="handleKey()"
        />
        <button>Search</button>
      </form>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>company</th>
            <th>address</th>
            <th>phone</th>
            <th>username</th>
            <th>website</th>
          </tr>
        </thead>
        <tbody>
          {user.map((q) => {
            return (
              <tr key={q.id}>
                <td>{q.name}</td>
                <td>{q.company.name}</td>
                <td>{q.address.city}</td>
                <td>{q.phone}</td>
                <td>{q.username}</td>
                <td>{q.website}</td>
                <td>{q.email}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};

export default Userdata;
